import React from 'react'
import { Container, Grid, Paper } from '@mui/material'
import { Logo } from '../../components/logoUdeA/Logo';
import logoUdeA from '../../assets/logos/logosimbolo-horizontal-png.png';
import logoIng from '../../assets/logos/facultad-ingenieria.png';
import { Ingreso } from '../../components/ingreso/Ingreso';

export const Login = () => {    
    return (
        <Container maxWidth='xl'>
            <Paper sx={{margin: '0.5em',padding:'1.2em', borderRadius:'0.5em'}}>
                <Grid
                    container spacing ={2} 
                    direction={'row'} 
                    alignItems={'center'} 
                    justifyContent={'space-evenly'}
                    sx={{minHeight:'10vh'}}
                    >
                    <Logo logo={logoIng}/>
                    <Ingreso mensaje={'Laboratorio Remoto'}/>
                </Grid>
            </Paper>
        </Container>
    )
}
